using Lantern.Beacon.Networking.Codes;
using Lantern.Beacon.Networking.Encoding;
using Lantern.Beacon.Sync;
using Lantern.Beacon.Sync.Types.Ssz.Deneb;
using Lantern.Beacon.Sync.Types.Ssz.Phase0;
using Microsoft.Extensions.Logging;
using Moq;
using NUnit.Framework;
using SszSharp;

namespace Lantern.Beacon.Tests;

public class ReqRespHelpersTests
{
    private SyncProtocol _syncProtocol;
    private Mock<ILogger<SyncProtocol>> mockLogger = null!;
    private Mock<ILoggerFactory> mockLoggerFactory = null!;
    
    [SetUp]
    public void Init()
    {
        var mockLoggerFactory = new Mock<ILoggerFactory>();
        
        _syncProtocol = new SyncProtocol(new SyncProtocolOptions
        {
            Preset = SizePreset.MainnetPreset,
            GenesisValidatorsRoot = Convert.FromHexString("4b363db94e286120d76eb905340fdd4e54bfe9f06bf33ff6cf5ad27f511bfe95"),
            GenesisTime = 1606824023
        }, mockLoggerFactory.Object);   
    }
    
    [Test]
    public void Test_EncodeRequest_ShouldEncodeRequestCorrectly()
    {
       var goodByeRequest = new Goodbye
       {
           Reason = (byte)GoodbyeReasonCodes.TooManyPeers
       };
       var encodedRequest = ReqRespHelpers.EncodeRequest(Goodbye.Serialize(goodByeRequest));
       var decodeRequest = ReqRespHelpers.DecodeRequest(encodedRequest);
       var goodBye = Goodbye.Deserialize(decodeRequest);
       
       Assert.That(encodedRequest, Is.Not.Null);
       Assert.That(decodeRequest, Is.Not.Null);
       Assert.That(goodBye, Is.Not.Null);
       Assert.That(goodBye.Reason, Is.EqualTo((byte)GoodbyeReasonCodes.TooManyPeers));
    }
    
    [Test]
    public void Test_DecodeRequest_ShouldDecodeRequestCorrectly()
    {
        var goodByeResponse = Convert.FromHexString("08FF060000734E61507059010C000002CD16568100000000000000");
        var decodedResponse = ReqRespHelpers.DecodeRequest(goodByeResponse);
        var goodBye = Goodbye.Deserialize(decodedResponse);
        
        Assert.That(decodedResponse, Is.Not.Null);
        Assert.That(goodBye, Is.Not.Null);
        Assert.That(goodBye.Reason, Is.EqualTo((byte)GoodbyeReasonCodes.TooManyPeers));
    }
    
    [Test]
    public void Test_EncodeResponse_ShouldEncodeResponseCorrectly()
    {
        var defaultGoodBye = new Goodbye
        {
            Reason = (byte)GoodbyeReasonCodes.TooManyPeers
        };
        var encodedResponse = ReqRespHelpers.EncodeResponse(Goodbye.Serialize(defaultGoodBye), ResponseCodes.Success);
        var decodedResponse2 = ReqRespHelpers.DecodeResponse(encodedResponse);
        var goodBye = Goodbye.Deserialize(decodedResponse2.Item1);
        
        Assert.That(decodedResponse2, Is.Not.Null);
        Assert.That(goodBye, Is.Not.Null);
        Assert.That(goodBye.Reason, Is.EqualTo((byte)GoodbyeReasonCodes.TooManyPeers));
        Assert.That(decodedResponse2.Item2, Is.EqualTo(ResponseCodes.Success));
    }
    
    [Test]
    public void Test_DecodeResponse_ShouldDecodeResponseCorrectly()
    {
        var metaDataResponse = Convert.FromHexString("0011FF060000734E615070590115000086293AD70100000000000000000080010000000000");
        var decodedResponse = ReqRespHelpers.DecodeResponse(metaDataResponse);
        var metadata = MetaData.Deserialize(decodedResponse.Item1);
        
        Assert.That(decodedResponse, Is.Not.Null);
        Assert.That(metadata, Is.Not.Null);
        Assert.That(metadata.SeqNumber, Is.EqualTo(1));
        Assert.That(decodedResponse.Item2, Is.EqualTo(ResponseCodes.Success));
    }

    [Test]
    public void Test_DecodeResponseChunk_ShouldDecodeResponseChunkCorrectly()
    {
        var lightClientBootstrapResponse = Convert.FromHexString(
            "");
        var decodedResponse = ReqRespHelpers.DecodeResponseChunk(lightClientBootstrapResponse);
        var denebLightClientBootstrap = DenebLightClientBootstrap.Deserialize(decodedResponse.Item3, _syncProtocol.Options.Preset);
        
        Assert.That(decodedResponse, Is.Not.Null);
        Assert.That(denebLightClientBootstrap, Is.Not.Null);
        Assert.That(decodedResponse.Item1, Is.EqualTo((byte)ResponseCodes.Success));
        Assert.That(decodedResponse.Item2.Length, Is.EqualTo(4));
    }
}